import React, {useState} from 'react';
import Word from './Word';
import './App.css';

function App() {

  const words = ['IT', 'IS', 'TEN', 'TWENTY', 'FIVE', 'QUARTER', 'HALF', 'PAST', 'TO', 'ONE', 'TWO', 'THREE',
                 'FOUR', 'FIVE', 'SIX', 'SEVEN', 'EIGHT', 'NINE', 'TEN', 'ELEVEN', 'TWELVE', 'O\'CLOCK'];

  let wordsLit = words.map(curWord => ({word: curWord, lit: true}));

  return (
    <div className="App">

      <div>
        <h3 className = "title">WORD CLOCK</h3>
      </div>

      <div>

      </div>

      <div className="flex-container">
        {wordsLit.map(curWord => (
          <Word text={curWord.word} lit={curWord.lit}/>
        ))}
      </div>

    </div>
  );
}

export default App;
